import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css"
import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="container">
        <Navbar />
        <br/>

        <Route exact path="/">
          <ExercisesList/>
        </Route>
        <Route path="/edit/:id">
          <EditExercise/>
        </Route>
        <Route path="/create">
          <CreateExercise/>
        </Route>
        <Route  path="/user">
          <CreateUser/>
        </Route>




      </div>
    </Router>
  );
}

export default App;
